import React from 'react';
import MainPosts from './MainPosts';
import WorkoutRecords from './WorkoutRecords';
const MainContents = () => {
	return (
		<MainContentsWrapper>
			<MainPosts></MainPosts>
			<WorkoutRecords></WorkoutRecords>
		</MainContentsWrapper>
	);
};

export default MainContents;
